import React, { useEffect } from "react";
import "./css/canvas.css";

import { App } from "./tools/app";

function Tutorial2() {
  useEffect(() => {
    new App();
  });
  return new App();
  return <div id="canvas"></div>;
}

export default Tutorial2;
